(6, 'he-init_css', '.ar {\n   direction:rtl;\n   text-align : right ;\n}\n.FetureCopy{\ncolor:red;\n  font-weight:700\n}\n.f_keys {\n  display:inline-block !important ; \n  width :350px;\n  color :blue;\n /* float:left;*/\n}\n\n.f_edit{\n  display:inline-block !important ; \n  width :44%;\n}\n\n.DelFeature , .updFeature {  \n  width :20%\n}  \n\n.sec1{\n  background-color : #a9b3e8; \n  padding:8px;\n}\n\n.sec2{\n  background-color : #f7f7f7; \n  padding:5px;\n  min-height:400px;\n}\n\n.sec3{\n  background-color : #8e5998; \n  padding:5px;\n}\n.widget1{\n  border:2px solid #ddd;\n  padding:10px; \n  text-align : center;\n} \n\n.f_group{\n \n  background-color:#f6f6f6;\n  padding:10px;\n}\n\n.f_add{\n   background-color:#f6f6f6;\n  padding:10px;\n  \n} \n.form-control::-webkit-input-placeholder { \n  color: #d5d5d5;\n}\n\n.footer{\n  \n padding:10px;\n color:white; \n font-size:14px \n}\n\n.colWidth {\n  width:80px;\n  display:inline-block;\n} \n\n.theKey, .theval{\n direction:ltr;\n text-align:left\n}\n.f_group ,.f_add {\n  border-radius :8px;\n  margin:15px;\n}\n\n.FetureCopy{\n   width:45%;\n   display:inline-block;\n   text-align :center;\n   font-size:22px;\n} \n\n.addgroup  {\n  position:relative;\n  top:-5px;\n}\n\n.addFeatur {\n  position:relative;\n  top:-3px;\n}\n\n.logo{\n  margin-right:10px\n}\n\n.header{\n Font-size:20px; \n  font-weight :600;\n  color:#666\n}', 'E'),
(7, 'he-init_js', '$(\".theval\").unbind().on(\"input\" , function(){\n//$oldval = $(this).next(\".updFeature\").attr(\"data-val\"));\n$(this).next(\".updFeature\").attr(\"data-val\" , $(this).val())\n  \n})\n\n$(\"#addGroup\").unbind().click(function(){   \n  var res = prompt(\"Enter Feature Group name after feature\", \"feature_\");\n  if(res){\n   window.livewire.emit(\"addGroup\", res);\n  }\n})\n\ntoast (\"Js Ok..\");', 'E'),
