(18, 'tree-manager-component_css', '.decode{\ndisplay:none !important\n}\n.search_in{\ndisplay:inline-block !important;\nwidth:200px !important\n}\n\n.decode{\n  border: 1px solid #ddd;\n  display:inline-block;\n  position:relative ;\n  top:-17px;\n  font-size:20px;\n  padding: 0px 5px\n}  \ntextarea {\n width:100% !important; \n}\n.table td , .table th{\n   padding:5px 10px !important;\n   text-align : center;\n}\n#treePart{\n  height:600px;\n  width:100%;\n  overflow:auto;\n /* border:1px solid #ddd;*/\n \n}\n\n#treeCard {\n   padding:20px !important;   \n}\n\n\n @page {\n        size: A4 !important;\n    }  \n\n@media print\n{  \nbody * {\n  visibility: hidden; \n  }\n#treeCard *{\n  visibility: visible;\n  }  \n  \n  body{\n  margin:30px;\n  padding:0px;\n  }  \n  \n #treeCard{   \n  width :100% !important;\n \n  position:absolute;\n  right:0px;\n  top: 0px;\n   \n  }\n  \n  .insidCard{\n    display: block;\n    overflow: auto;\n    border:2px solid red;\n    padding:60px;\n    background:white;\n    height: 100% !important;\n \n  }\n  \n.caret{\n        white-space :normal;        \n    };\n}\n\n.tree{\n  background :white !important;\n} \n\n.btnc{\n  width:130px;\n  font-size :16px;\n  height :30px\n}\n\n.btnh{\n  font-size :16px;\n  height :35px;\n  padding:0px 5px;\n  position:relative;\n  top:-3px\n} \n', 'E'),
