(20, 'tree-manager-component_js', '$(\".printTree\").unbind().click(function(){\n  toast(\"print\");\n  window.print();\n})\n\n$(\"#openAllNode\").unbind().click(function(){\n     $(\".caret\").each((i,e)=>{\n        $(e).toggleClass(\"caret-down\");\n        $(e).parent().find(\".nested\").toggleClass(\"active\");\n      \n     });\n  \n   toast(0)\n   // toast(\"ok js...\");\n})\n\n\n', 'E'),
