(27, 'form-builder_css', '.btn-file {\n  position: relative;\n  overflow: hidden;\n  border:1px solid #ccc;\n  padding:5px;\n  margin-bottom :5px;\n  background-color:#ccc    \n}\n.btn-file input[type=file] {\n  position: absolute;\n  top: 0;\n  right: 0;\n  min-width: 100%;\n  min-height: 100%;\n  font-size: 100px;\n  text-align: right;\n  filter: alpha(opacity=5);\n  opacity: 0;\n  outline: none;\n  background: white;\n  cursor: inherit;\n  display: block;\n}\n\n\n.autoli{\n list-style-type:none;\n cursor :pointer;\n padding :3px;\n  background-color:#ccc;\n  margin:5px\n}  \n\n.footerArea{\n  padding : 8px;\n}\n\n.feildTitle{\n  \n  display:inline-block;\n  border :1px solid #eee;\n  width:100%;\n  line-height:2;\n  background-color:#ddd;\n  height:100%;\n  text-align:center;\n  font-weight:600\n  \n}\n\n.betweenFeild{\n  margin-bottom :8px;\n}  ', 'E'),
