(41, 'cols-options_his', '[\"<div class=\\\"el\\\">New_Component_cols-options<\\/div>\",\"<div class=\\\"el \\\">New_Component_cols-options\\n    <div class=\\\"section section_class el el_border_4\\\">\\n        <div class=\\\"container container_class el el_border_4\\\">\\n            <div class=\\\"row row_class el el_border_4 \\\">\\n                <div class=\\\"col-12 col-12_class el el_border_4\\\"><\\/div>\\n            <\\/div>\\n        <\\/div>\\n    <\\/div>\\n<\\/div>\",\"<div class=\\\"el\\\">New_Component_cols-options\\n    <div class=\\\"section section_class el el_border_4\\\">\\n        <div class=\\\"container container_class el el_border_4\\\">\\n            <div class=\\\"row row_class el el_border_4\\\">\\n\\n            <\\/div>\\n        <\\/div>\\n    <\\/div>\\n<\\/div>\",\"<div class=\\\"el\\\">New_Component_cols-options\\n    <div class=\\\"section section_class el el_border_4\\\">\\n        <div class=\\\"container container_class el el_border_4\\\">\\n            <div class=\\\"row row_class el el_border_4 \\\">\\n\\n                <div class=\\\"col-4 col-4_class el el_border_4\\\"><\\/div>\\n            <\\/div>\\n        <\\/div>\\n    <\\/div>\\n<\\/div>\",\"<div class=\\\"el\\\">New_Component_cols-options\\n    <div class=\\\"section section_class el el_border_4\\\">\\n        <div class=\\\"container container_class el el_border_4\\\">\\n            <div class=\\\"row row_class el el_border_4 \\\">\\n\\n                <div class=\\\"col-4 col-4_class el el_border_4\\\"><\\/div>\\n                <div class=\\\"col-4 col-4_class el el_border_4\\\"><\\/div>\\n            <\\/div>\\n        <\\/div>\\n    <\\/div>\\n<\\/div>\",\"<div class=\\\"el\\\">New_Component_cols-options\\n    <div class=\\\"section section_class el el_border_4\\\">\\n        <div class=\\\"container container_class el el_border_4\\\">\\n            <div class=\\\"row row_class el el_border_4 \\\">\\n\\n                <div class=\\\"col-4 col-4_class el el_border_4\\\"><\\/div>\\n                <div class=\\\"col-4 col-4_class el el_border_4\\\"><\\/div>\\n                <div class=\\\"col-4 col-4_class el el_border_4\\\"><\\/div>\\n            <\\/div>\\n        <\\/div>\\n    <\\/div>\\n<\\/div>\",\"<div class=\\\"el\\\">\\n    <div class=\\\"el\\\">Cols Options -\\n        {{$ic}}\\n    <\\/div>\\n    <div class=\\\"section section_class el\\\">\\n        <div class=\\\"container container_class el\\\">\\n            <div class=\\\"row row_class el\\\">\\n\\n                <div class=\\\"col-4 col-4_class el\\\">\\n                    <select class=\\\"form-select selected_column m-1 el\\\" wire:model=\\\"colName\\\">\\n                        @foreach($columns as $col)\\n                          <option val=\\\"{{$col}}\\\" class=\\\"el\\\">{{$col}}<\\/option>\\n                        @endforeach\\n                    <\\/select>\\n                <\\/div>\\n\\n\\n                <div class=\\\"col-4 col-4_class el\\\">\\n                    <select class=\\\"form-select selected_column m-1 el\\\" wire:model=\\\"table\\\">\\n                        @foreach ($tableNames as  $tbName)\\n                            <option class=\\\"el\\\">{{$tbName}}<\\/option>\\n                        @endforeach\\n                     <\\/select>\\n\\n                <\\/div>\\n                <div class=\\\"col-4 col-4_class el\\\">\\n                    <select class=\\\"form-select selected_column m-1 el\\\" wire:model=\\\"formName\\\">\\n                        @foreach($formNames as $form)\\n                          <option val=\\\"{{$form}}\\\" class=\\\"el\\\">{{$form}}<\\/option>\\n                        @endforeach\\n                    <\\/select>\\n                <\\/div>\\n            <\\/div>\\n        <\\/div>\\n        <div style=\\\"padding: 10px\\\" class=\\\"el\\\">\\n\\n\\n            {{-- --}}\\n\\n            <table class=\\\"table el\\\" id=\\\"col_option_table\\\" style=\\\"width:100%\\\">\\n\\n                @php   $ic = 1;   @endphp\\n                {{dd( $colOptions)}}\\n                @foreach( $options as $key => $col)\\n\\n                @if (fmod($ic , 3) == 1 )\\n                <tbody class=\\\"el\\\">\\n                    <tr class=\\\"el\\\">\\n                        @endif\\n                        <td class=\\\"el\\\" id=\\\"option_key_{{$ic}}\\\" style=\\\"font-weight:700;padding:5px;width:10%;background-color:rgb(238, 233, 223)\\\">\\n                            {{$key}}\\n                        <\\/td>\\n                        <td class=\\\"key_Val_opt el\\\">\\n                            <input wire:model=\\\"options.{{$key}}\\\" type=\\\"text\\\" class=\\\"form-control el\\\" id=\\\"option_value_{{$ic}}\\\">\\n                        <\\/td>\\n\\n                        @if (fmod($ic , 3) == 0 )\\n                    <\\/tr>\\n                    @endif\\n\\n                    @php   $ic++;   @endphp\\n                    @endforeach\\n\\n                <\\/tbody>\\n            <\\/table>\\n\\n            <input wire:click=\\\"saveOptions\\\" type=\\\"button\\\" class=\\\"btn btn-primary mt-2 el\\\" value=\\\"Save Option\\\">\\n        <\\/div>\\n    <\\/div>\\n\\n    <div id=\\\"topMsg\\\" class=\\\"topMsg el\\\">\\n        @if (isset($this->msgs))\\n        {!! implode(\'<br class=\\\"el\\\">\', $this-&gt;msgs) !!}\\n        @php $this->msgs=null @endphp\\n        @endif\\n    <\\/div>\\n<\\/div>\"]', 'E'),
