(56, 'drag-drop_js', 'function dragStartEle(e){\n  e.target.style.color = \'blue\';\n  e.target.parentElement.style.border = \'1px dashed red\'; \n  e.dataTransfer.setData(\"text\", e.target.id);  \n\n}\n\nfunction dragEnd(e){\n    e.preventDefault();  \n    e.target.parentElement.style.border = \'1px solid blue\'; \n    e.target.style.color = \'black\';\n}\n\nfunction dragOver(e){\n  e.preventDefault();  \n // e.target.style.backgroundColor  = \'#eee\'; \n}\n\nfunction dragEnter(e){\n  e.preventDefault(); \n  console.log(e.target.classList);\n  e.target.style.backgroudColor = \'#red\'; \n}\n\nfunction dragLeave(e){\n  e.preventDefault();  \n   e.target.style.backgroudColor = \'#fff\';\n // e.target.style.backgroundColor  = \'red\'; \n}\n\nfunction acceptDrop(e){\n    e.preventDefault(); \n     //alert(\"dropped\");\n}', 'E');
